import React from 'react';
import { Link } from 'react-router-dom';

class Navbar extends React.Component {
	render() {
		return (
			<nav className="navbar navbar-expand-sm navbar-dark px-sm-5">
			  <ul>
			    <li>Logo</li>
			    <li>Men</li>
			    <li>Women</li>
			    <li>Kids</li>
			    <li>Card</li>
			  </ul>
			</nav>
		)
	}
}

export default Navbar;
